script: |
  super -f text -I q1761.spq | sort > q1761.out

inputs:
  - name: q1761.spq
    data: |
      SELECT col2 + 89 - + col1 AS col1 FROM tab1 (FORMAT parquet) cor0 WHERE NOT + col0 * - + ( - col1 ) IN ( col1 + col1, col2, + - col0 / col2 );
  - name: tab1

outputs:
  - name: q1761.out
    data: |
      110
      143
      171
